import React from 'react';
import './TableList.css';

class TableList extends React.Component {

   render() {
      const listItems = this.props.datatList.map(
         (item) =>
         <table key={item._id}>
            <th>Name</th>
            <th>Hospital</th>
            <th>Date From</th>
            <th>Date To</th>
            <th>Status</th>
         </table>
            // <div key={item._id} className="div_row_wrap">
            //    <div className="div_row_col"> {item.patient.name} </div>
            //    <div className="div_row_col"> {item.hospital} </div>
            //    <div className="div_row_col"> {item.date_from} </div>
            //    <div className="div_row_col"> {item.date_to} </div>
            //    <div className="div_row_col"> {item.isApproved ? 'Approves' : 'Pending'} </div>
            // </div>
      );

      return (
         <div>
            <h2>Table List</h2>
            {listItems}
         </div>
      )
   }
}

export default TableList;
